(217, 1, 106646, 'The Wolf of Wall Street', 'A New York stockbroker refuses to cooperate in a large securities fraud case involving corruption on Wall Street, corporate banking world and mob infiltration. Based on Jordan Belfort\'s autobiography.', 101.49, '2013-12-25', 8.033, 'https://image.tmdb.org/t/p/original//63y4XSVTZ7mRzAzkqwi3o0ajDZZ.jpg', 'https://image.tmdb.org/t/p/original//kW9LmvYHAaS9iA0tHmZVq8hQYoq.jpg', 1, '2024-12-21 07:27:09', '0000-00-00 00:00:00'),
(218, 10, 50839, 'Margin Call', 'A thriller that revolves around the key people at an investment bank over a 24-hour period during the early stages of the financial crisis.', 24.46, '2011-02-11', 6.86, 'https://image.tmdb.org/t/p/original//thWL3gIJpi9jNW91dkMa25xExId.jpg', 'https://image.tmdb.org/t/p/original//pgMIdInSIGw0uSory7yEBFGrvIS.jpg', 1, '2024-12-21 07:32:33', '0000-00-00 00:00:00'),
(219, 10, 1365712, 'Money Electric: The Bitcoin Mystery', 'A deep dive into one of the most enduring and high-stakes mysteries in technology and finance: the origins of Bitcoin and the identity of its anonymous creator, Satoshi Nakamoto.', 16.641, '2024-10-08', 6.2, 'https://image.tmdb.org/t/p/original//huRRHTVIPF10XG3SbAyvHs5K9Ks.jpg', 'https://image.tmdb.org/t/p/original//rAC1FOLjDXaWEgNBJXtWYGq9SRE.jpg', 1, '2024-12-21 07:36:57', '0000-00-00 00:00:00'),
(220, 10, 1181538, 'Crypto Boy', 'Following a dispute with his father, a young man falls prey to cryptocurrency\'s allure and an entrepreneur\'s audacious promises of financial freedom.', 5.478, '2023-10-19', 6.7, 'https://image.tmdb.org/t/p/original//wn8Jgn9nzyaINM3oIsBlpt8UuHr.jpg', 'https://image.tmdb.org/t/p/original//SVbLd0L1L611hWYGxSqyFyGu1f.jpg', 1, '2024-12-21 07:39:49', '0000-00-00 00:00:00'),
(221, 10, 567733, 'Crypto', 'A young agent is tasked with investigating a tangled web of corruption and fraud in New York.', 14.166, '2019-04-12', 5.4, 'https://image.tmdb.org/t/p/original//xz5I9tqoSnaauJwNV1zyt17SQTi.jpg', 'https://image.tmdb.org/t/p/original//fzTvnA3buXsjdmjrYRDozKBFF78.jpg', 1, '2024-12-21 07:40:07', '0000-00-00 00:00:00'),
(222, 10, 37799, 'The Social Network', 'In 2003, Harvard undergrad and computer programmer Mark Zuckerberg begins work on a new concept that eventually turns into the global social network known as Facebook. Six years later, Mark is one of the youngest billionaires ever, but his unprecedented success leads to both personal and legal complications when he ends up on the receiving end of two lawsuits, one involving his former friend.', 50.378, '2010-10-01', 7.372, 'https://image.tmdb.org/t/p/original//1PXwh3nJzgRkkYnqfWInJNypeL4.jpg', 'https://image.tmdb.org/t/p/original//n0ybibhJtQ5icDqTp8eRytcIHJx.jpg', 1, '2024-12-21 07:40:42', '0000-00-00 00:00:00'),
(223, 10, 946327, 'Trust No One: The Hunt for the Crypto King', 'When the young founder of a collapsing cryptocurrency exchange dies unexpectedly, irate investors suspect there\'s more to his death than meets the eye.', 10.31, '2022-03-30', 6.2, 'https://image.tmdb.org/t/p/original//poL87RE9mtvfiAKas8DHtdqA6nG.jpg', 'https://image.tmdb.org/t/p/original//2ZzllPVrYmBn28Kc7PZaQ0PrQat.jpg', 1, '2024-12-21 07:41:11', '0000-00-00 00:00:00'),
(224, 10, 758302, 'Crypto Rush', 'A story of a Russian woman who accidentally invested in a cryptocurrency mining farm. This investment drove her to investigate the history-making hype surrounding Bitcoin. She speaks with diverse experts as she travels across the globe, from Russia to the USA, Switzerland to Hong Kong, Singapore, China, and South Korea. The film is a contextual, culturally-focused dive into ten big, global cities where the viewer will uncover answers to the question “What is Bitcoin and Blockchain?” and, in the process, discover the real people standing behind this 21st-century digital Gold Rush.', 0.02, '2020-04-22', 0, 'https://image.tmdb.org/t/p/original/null', 'https://image.tmdb.org/t/p/original//9HuyqTbbP8dEhu5IWj4V6Q1Off6.jpg', 1, '2024-12-21 07:41:57', '0000-00-00 00:00:00'),
(225, 9, 1271, '300', 'Based on Frank Miller\'s graphic novel, \"300\" is very loosely based the 480 B.C. Battle of Thermopylae, where the King of Sparta led his army against the advancing Persians; the battle is said to have inspired all of Greece to band together against the Persians, and helped usher in the world\'s first democracy.', 54.046, '2007-03-07', 7.2, 'https://image.tmdb.org/t/p/original//eGhjeUbzttA3E4flxdAm8gHz4h4.jpg', 'https://image.tmdb.org/t/p/original//h7Lcio0c9ohxPhSZg42eTlKIVVY.jpg', 1, '2024-12-21 07:55:52', '0000-00-00 00:00:00'),
(226, 9, 299536, 'Avengers: Infinity War', 'As the Avengers and their allies have continued to protect the world from threats too large for any one hero to handle, a new danger has emerged from the cosmic shadows: Thanos. A despot of intergalactic infamy, his goal is to collect all six Infinity Stones, artifacts of unimaginable power, and use them to inflict his twisted will on all of reality. Everything the Avengers have fought for has led up to this moment - the fate of Earth and existence itself has never been more uncertain.', 184.541, '2018-04-25', 8.2, 'https://image.tmdb.org/t/p/original//mDfJG3LC3Dqb67AZ52x3Z0jU0uB.jpg', 'https://image.tmdb.org/t/p/original//7WsyChQLEftFiDOVTGkv3hFpyyt.jpg', 0, '2024-12-21 11:38:00', '0000-00-00 00:00:00');
